import React from 'react';
import ReactDOM from 'react-dom';

class Indicator extends React.Component {
  render() {
    return(
      <li data-target={this.props.item.dataTarget} data-slide-to={this.props.item.num} class={this.props.item.iClass}></li>
    );
  }
}

export default Indicator
